import React, { useState, useEffect } from "react";
import axios from "axios";

const ProductList = () => {
    const [products, setProducts] = useState([]);
    const [category, setCategory] = useState("");
    const [subcategory, setSubcategory] = useState("");
    const [productName, setProductName] = useState("");

    useEffect(() => {
        fetchProducts();
    }, []);

    const fetchProducts = async () => {
        try {
            const response = await axios.get("http://localhost:8080/api/products");
            if (Array.isArray(response.data)) {
                setProducts(response.data);
            } else {
                console.error("API response is not an array:", response.data);
                setProducts([]);
            }
        } catch (error) {
            console.error("Error fetching products:", error);
            setProducts([]);
        }
    };

    const fetchByCategory = async () => {
        if (!category.trim()) return;
        try {
            const response = await axios.get(`http://localhost:8080/api/products/category/${category}`);
            setProducts(Array.isArray(response.data) ? response.data : []);
        } catch (error) {
            console.error("Error fetching by category:", error);
            setProducts([]);
        }
    };

    const fetchBySubcategory = async () => {
        if (!subcategory.trim()) return;
        try {
            const response = await axios.get(`http://localhost:8080/api/products/subcategory/${subcategory}`);
            setProducts(Array.isArray(response.data) ? response.data : []);
        } catch (error) {
            console.error("Error fetching by subcategory:", error);
            setProducts([]);
        }
    };

    const fetchByProductName = async () => {
        if (!productName.trim()) return;
        try {
            const response = await axios.get(`http://localhost:8080/api/products/name/${productName}`);
            setProducts(Array.isArray(response.data) ? response.data : []);
        } catch (error) {
            console.error("Error fetching by name:", error);
            setProducts([]);
        }
    };

    return (
        <div className="product-container">
            <h2>Product List</h2>

            <div className="filters">
                <input
                    type="text"
                    placeholder="Filter by Category"
                    value={category}
                    onChange={(e) => setCategory(e.target.value)}
                />
                <button onClick={fetchByCategory}>Search</button>

                <input
                    type="text"
                    placeholder="Filter by Subcategory"
                    value={subcategory}
                    onChange={(e) => setSubcategory(e.target.value)}
                />
                <button onClick={fetchBySubcategory}>Search</button>

                <input
                    type="text"
                    placeholder="Filter by Product Name"
                    value={productName}
                    onChange={(e) => setProductName(e.target.value)}
                />
                <button onClick={fetchByProductName}>Search</button>
            </div>

            <table className="product-table">
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>Description</th>
                        <th>Price</th>
                        <th>Stock</th>
                        <th>Category</th>
                        <th>Subcategory</th>
                    </tr>
                </thead>
                <tbody>
                    {products.length > 0 ? (
                        products.map((product) => (
                            <tr key={product.id || product.product_id}>
                                <td>{product.id || product.product_id}</td>
                                <td>{product.name || product.product_name}</td>
                                <td>{product.description}</td>
                                <td>${product.price}</td>
                                <td>{product.stock}</td>
                                <td>{product.categoryName || product.category_id}</td>
                                <td>{product.subcategoryName || product.subcategory_id}</td>
                            </tr>
                        ))
                    ) : (
                        <tr>
                            <td colSpan="7" style={{ textAlign: "center" }}>No products found</td>
                        </tr>
                    )}
                </tbody>
            </table>
        </div>
    );
};

export default ProductList;
